const images = (props) => {
  switch (props.imagem) {
    case 'feijoadaIco':
      return require('../img/feijoada.png')
    case 'macarraoIco': 
      return require('../img/macarrao.png')
    default:
      return require('../img/feijoada.png')
  }
};

export default images;
